import React, { useEffect, useState } from "react";
import { readDeck } from "../../utils/api";
import Header from "./../Header";

function Study() {
  const [cards, setCards] = useState([]);

  useEffect(() => {
    async function getCards() {
      const cardsList = await readDeck();
      setCards(cardsList);
    }
    setCards();
  }, []);
}

export default Study;
